import React from 'react'

const Header = () => {
  return (
    <div className='bg-gradient-to-b from-black'>
      <img className='w-56' src = "https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/799px-Netflix_2015_logo.svg.png" alt='logo' />

      <div>
        <h1 className='text-white text-3xl font-bold'>Netflix</h1>
      </div>


      </div>
  )
}

export default Header
